import React from "react";
function About(props){
    return(
        <>
        <h1>Hello {props.name} </h1>
        <h1>Age {props.age}</h1>
        </>
    );
}
function App(){
    return(
        <>
        <About name =" Harish " age= "21" ></About>
        </>
    )
}

export default App;
